    <script>
        //LOAD the game, but don't start it until the ad is visible

        window.onload = function() {
            if (mraid.getState() === 'loading') {
                mraid.addEventListener('ready', onSdkReady);
            } else {
                onSdkReady();
            }

            function viewableChangeHandler(viewable) {
                // start/pause/resume gameplay, stop/play sounds
                if (viewable) {
                    document.getElementById("bgMusic").play()
                    showMyAd();
                } else {
                    document.getElementById("bgMusic").pause()
                        // pause
                }
            }

            function onSdkReady() {
                mraid.addEventListener('viewableChange',
                    viewableChangeHandler);
                // Wait for the ad to become viewable for the first time
                if (mraid.isViewable()) {
                    showMyAd();
                }
            }

            function showMyAd() {

            }

        };

        function openURL() {
            // Detect platform from user agent
            var userAgent = navigator.userAgent || navigator.vendor;
            var url = "https://apps.apple.com/us/app/splashlearn-kids-learning-app/id672658828";
            var android = "https://play.google.com/store/apps/details?id=com.splash.kids.education.learning.games.free.multiplication.reading.math.grade.app.splashmath";
            if (/android/i.test(userAgent)) {
                url = android;
            }
            mraid.open(url);

        }
    </script>
